import vase from './images/superb-vase.jpg';
import building from './images/tall-building.jpg';
import slope from './images/slope-and-mountain.jpg';
import skyScraper from './images/sky-scrapers.jpg';
import pinkCurl from './images/pink-curl.jpg';
import bridge from './images/night-in-city.jpg';
import cubes from './images/complex-sorted-cubes.jpg';
import mountain from './images/mountain.jpg';
import aisle from './images/aisle-in-a-house.jpg';


export default function Hero() {
  return (
    <main>
        <div className='photos'>
            <div className='col-1'>
                <img src={ vase } alt='first logo'/>
            </div>
            <div className='col-2'>
                <img src={ building } alt='second logo'/>
                <img src={ slope } alt='third logo'/>
            </div>
            <div className='col-3'>
                <img src={ skyScraper } alt='fourth logo'/>
                <img src={ pinkCurl } alt='fifth logo'/>
            </div>
            <div className='col-4'>
                <img src={ bridge } alt='sixth logo'/>
                <img src={ cubes } alt='seventh logo'/>
            </div>
            <div className='col-5'>
                <img src={ mountain } alt='eigth logo'/>
                <img src={ aisle } alt='ninth logo'/>
            </div>
        </div>
        <div className='aside'>
            <h1>Online Experiences</h1>
            <p>The following list are online experiences from our most valuable customers</p>
            </div>
    </main>
  );
};
